                Name: "Quốc lộ 91B",
                Description: "Đường Nam Sông Hậu – Quốc lộ 91B bắt đầu từ giao lộ với Quốc lộ 91 tại quận Ô Môn, Cần Thơ, đi vòng xuống phía nam sân bay Cần Thơ rồi cắt qua khu vực nội đô Cần Thơ và giao với Quốc lộ 1 (đoạn đường dẫn cầu Cần Thơ) tại nút giao IC3. Từ đây, tuyến đường tiếp tục đi gần như song song với bờ Nam sông Hậu đến cửa biển Trần Đề, tỉnh Sóc Trăng. Sau đó, tuyến đường lại đi dọc bờ biển tỉnh Sóc Trăng sang tỉnh Bạc Liêu rồi kết thúc tại điểm giao với Quốc lộ 1 ở cửa ngõ phía bắc thành phố Bạc Liêu. Tuyến đường đi qua các quận Ô Môn, Bình Thủy, Ninh Kiều, Cái Răng (Cần Thơ); huyện Châu Thành (Hậu Giang); các huyện Kế Sách, Long Phú, Trần Đề, thị xã Vĩnh Châu (Sóc Trăng) và thành phố Bạc Liêu (Bạc Liêu).",
